import styled from "styled-components";
import Title from "../../ui/title/title";
import Img from "../../styled";

export const Section = styled.section`
  width: 770px;
  margin: 0 auto;
  margin-bottom: 120px;
`;

export const StyledTitle = styled(Title)`
  margin-bottom: 55px;
  text-align: center;
`;

export const StyledImg = styled(Img)`
  width: 770px;
  height: 301px;
  margin-bottom: 17px;
`;
